import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter, Routes, Route } from 'react-router-dom';

const App = () => {
  return (
    <div className="App">
       <BrowserRouter>
       <Routes>
         <Route path='/'>
           Home
         </Route>
       </Routes>
       </BrowserRouter>
    </div>
  );
}

export default App;
